                {/* <img hrc='./images/p1.jpg'/> */}
                </div>

                </div>)
            }


            {/* {islogin&&<LogIn islogin={islogin}/>} */}

            {isSingUp && <SingUP />}



        </>
    )
    // console.log(isSingUp);

}
export default Home;
